import React from "react";
import ServiceData from "../Service/ServiceData";

const CompNews5 = () => {
  return (
    <section className="blog_area sec_pad">
      <div className="container">
        <div className="row">
          <div className="col-lg-8 blog_sidebar_left">
            {ServiceData.News5.map((news5) => {
              return (
                <div className="blog_single mb_50">
                  <img
                    className="img-fluid"
                    src={require("../../img/" + news5.image)}
                    alt=""
                  />
                  <div className="blog_content">
                    <div className="post_date">
                      <h2>
                        <span>{news5.Year}</span>
                      </h2>
                    </div>
                    <h3 className="font-weight-bold t_color mb-30">
                      {news5.Title}
                    </h3>
                    <p className="ratakirkan">Udayana University (UNUD) hosted four prestigious national and international events, namely the International Science and Invention Fair (ISIF), Invention and Innovation Fair (IIF), National Research Teacher Competition (NRTC), and International Research Teacher Competition (IRTC) 2023
                    </p>
                    <p className="ratakirkan">
                    </p>

                    <p className="ratakirkan">
                    </p>
                    <p className="ratakirkan">
                    </p>
                    <p className="ratakirkan"></p>
                    <p className="ratakirkan"></p>
                    <p className="ratakirkan"></p>
                    <p className="ratakirkan"></p>
                    <p>
                      Source :
                      <a target="-blank" href={news5.LinkNews}>
                        Click Here
                      </a>
                    </p>
                  </div>
                </div>
              );
            })}
          </div>
          ;
        </div>
      </div>
    </section>
  );
};

export default CompNews5;
